import React from 'react';

const ComplianceDeadlines = () => {
  return (
    <div>
      <h3 className="text-lg font-medium text-gray-900">Compliance Deadlines</h3>
      <p className="text-sm text-gray-500 mt-1">Track and manage all your key legal and regulatory deadlines.</p>
    </div>
  );
};

export default ComplianceDeadlines;
